    "2016-03-17T07:00:56.141661",nt"name": "vendor-payments-vouchers-64994",nt"isopen":
    true,nt"url": null,nt"notes": "The San Francisco Controller's Office maintains
    a database of payments made to vendors from fiscal year 2007 forward. This data
    is presented on the Vendor Payments report hosted at http://openbook.sfgov.org,
    and is also available in this dataset in CSV format, which represents detailed data
    by voucher. We have removed sensitive information from this data u2013 this is intended
    to show payments made to entities providing goods and services to the City and County
    and to protect individuals. For example, we have removed payments to employees (reimbursements,
    garnishments) and jury members, revenue refunds, payments for judgments and claims,
    witnesses, relocation and rehousing, and a variety of human services payments. New
    data is added on a weekly basis.",nt"license_title": "Other License Specified",nt"extras":
